import logo from './logo.svg';
import './App.css';
import './assets/css/common.css'
import './assets/css/simplegrid.css'

function App() {
  return (
    <div className="main-container">
      <div className='grid'>
        <section>
          <img src='../assets/images/1.jpg'/>
        </section>
      </div>
    </div>
  );
}

export default App;
